BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "TB_OWNER_STEWARD" (
	"ConjuntodeDados"	TEXT NOT NULL,
	"SigladoConjuntodeDados"	TEXT NOT NULL,
	"DataOwner"	TEXT,
	"DataSteward"	TEXT,
	"PadrãodeNomenclaturadoConjuntodeDados"	TEXT NOT NULL,
	"DatadeCriação"	DATE NOT NULL,
	"StatusdoConjuntodeDados"	TEXT NOT NULL,
	PRIMARY KEY("ConjuntodeDados")
);
CREATE TABLE IF NOT EXISTS "TB_CLASSIFICACAO" (
	"ID_CLASSIFICACAO"	INTEGER NOT NULL,
	"NOME_CLASSIFICACAO"	TEXT NOT NULL UNIQUE,
	PRIMARY KEY("ID_CLASSIFICACAO" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "TB_VALOR_CLASSIFICACAO" (
	"ID_VALOR_CLASSIFICACAO"	INTEGER NOT NULL,
	"ID_CLASSIFICACAO"	INTEGER NOT NULL,
	"VALOR_CLASSIFICACAO"	TEXT NOT NULL,
	PRIMARY KEY("ID_VALOR_CLASSIFICACAO" AUTOINCREMENT),
	FOREIGN KEY("ID_CLASSIFICACAO") REFERENCES "TB_CLASSIFICACAO"("ID_CLASSIFICACAO")
);
CREATE TABLE IF NOT EXISTS "TB_CLASSIFICACAO_TABELA" (
	"ID_CLASSIFICACAO_TABELA"	INTEGER NOT NULL,
	"ID_TABELA"	TEXT NOT NULL,
	"ID_VALOR_CLASSIFICACAO"	TEXT NOT NULL,
	PRIMARY KEY("ID_CLASSIFICACAO_TABELA" AUTOINCREMENT),
	FOREIGN KEY("ID_TABELA") REFERENCES "TB_TABELA"("ID"),
	FOREIGN KEY("ID_VALOR_CLASSIFICACAO") REFERENCES "TB_VALOR_CLASSIFICACAO"("ID_VALOR_CLASSIFICACAO")
);
CREATE TABLE IF NOT EXISTS "TB_CAMPO_TABELA" (
	"ID_CAMPO_TABELA"	INTEGER NOT NULL,
	"NOME_CAMPO_TABELA"	TEXT NOT NULL,
	PRIMARY KEY("ID_CAMPO_TABELA" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "TB_CAMPO_VARIAVEL" (
	"ID_CAMPO_VARIAVEL"	INTEGER NOT NULL,
	"NOME_CAMPO_VARIAVEL"	TEXT NOT NULL,
	PRIMARY KEY("ID_CAMPO_VARIAVEL" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "TB_CAMPO_CONEXAO" (
	"ID_CAMPO_CONEXAO"	INTEGER NOT NULL,
	"NOME_CAMPO_CONEXAO"	TEXT NOT NULL,
	PRIMARY KEY("ID_CAMPO_CONEXAO" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "TB_TABELA" (
	"ID"	TEXT NOT NULL,
	"CONJUNTODADOS_PRODUTO"	TEXT NOT NULL,
	"ID_TABELA"	TEXT NOT NULL,
	"TABELA"	TEXT NOT NULL,
	"CONTEUDO_TABELA"	TEXT,
	"CRITICIDADE_TABELA"	TEXT,
	"DADOS_SENSIVEIS"	TEXT,
	"DEFASAGEM"	TEXT,
	"DATABASE"	TEXT NOT NULL,
	"CAMINHO"	TEXT NOT NULL,
	"SCRIPTS_ALIMENTACAO"	TEXT,
	"ENG_INGESTAO"	TEXT NOT NULL,
	"OWNER"	TEXT NOT NULL,
	"STEWARD"	TEXT NOT NULL,
	"INDICADORAJUSTENOMENCLATURATABELA"	TEXT NOT NULL,
	"LINK_SOL_ACESSO"	TEXT,
	"LINK_REPORTAR_ERRO"	TEXT,
	"RANKING_GOVERNANCA"	INTEGER,
	"QTD_VIZUALIZACAO"	INTEGER,
	PRIMARY KEY("ID"),
	FOREIGN KEY("CONJUNTODADOS_PRODUTO") REFERENCES "TB_OWNER_STEWARD"("ConjuntodeDados"),
	FOREIGN KEY("STEWARD") REFERENCES "TB_OWNER_STEWARD"("DataSteward"),
	FOREIGN KEY("OWNER") REFERENCES "TB_OWNER_STEWARD"("DataOwner")
);
CREATE TABLE IF NOT EXISTS "TB_CONEXAO" (
	"ID"	TEXT NOT NULL,
	"CONJUNTODADOS_PRODUTO"	TEXT NOT NULL,
	"TABELA"	TEXT,
	"ORDEM_ORIGEM"	INTEGER NOT NULL,
	"TABELA_ORIGEM"	TEXT,
	"SISTEMA_ORIGEM"	TEXT,
	"SERVIDOR_ORIGEM"	TEXT,
	"DATABASE_ORIGEM"	TEXT,
	"SCHEMA_ORIGEM"	TEXT,
	"TIPO_CONEXAO"	TEXT,
	"REPOSITORIO"	TEXT,
	"MECANICA"	TEXT,
	"FREQUENCIA"	TEXT,
	"MODO_ESCRITA"	TEXT,
	FOREIGN KEY("ID") REFERENCES "TB_TABELA"("ID"),
	FOREIGN KEY("CONJUNTODADOS_PRODUTO") REFERENCES "TB_TABELA"("CONJUNTODADOS_PRODUTO")
);
CREATE TABLE IF NOT EXISTS "TB_REQ_VARIAVEL" (
	"ID_REQ_VARIAVEL"	INTEGER NOT NULL,
	"ID_REQUISICAO"	INTEGER NOT NULL,
	"ID_CAMPO_VARIAVEL"	INTEGER NOT NULL,
	"ALTERACAO"	TEXT NOT NULL,
	"ALTERACAO_GOVERNANCA"	TEXT,
	PRIMARY KEY("ID_REQ_VARIAVEL" AUTOINCREMENT),
	FOREIGN KEY("ID_REQUISICAO") REFERENCES "TB_REQUISICAO"("ID_REQUISICAO"),
	FOREIGN KEY("ID_CAMPO_VARIAVEL") REFERENCES "TB_CAMPO_VARIAVEL"("ID_CAMPO_VARIAVEL")
);
CREATE TABLE IF NOT EXISTS "TB_REQ_TABELA" (
	"ID_REQ_TABELA"	INTEGER NOT NULL,
	"ID_REQUISICAO"	INTEGER NOT NULL,
	"ID_CAMPO_TABELA"	INTEGER NOT NULL,
	"ALTERACAO"	TEXT NOT NULL,
	"ALTERACAO_GOVERNANCA"	TEXT,
	PRIMARY KEY("ID_REQ_TABELA" AUTOINCREMENT),
	FOREIGN KEY("ID_CAMPO_TABELA") REFERENCES "TB_CAMPO_TABELA"("ID_CAMPO_TABELA"),
	FOREIGN KEY("ID_REQUISICAO") REFERENCES "TB_REQUISICAO"("ID_REQUISICAO")
);
CREATE TABLE IF NOT EXISTS "TB_STATUS" (
	"ID_STATUS"	INTEGER NOT NULL,
	"NOME_STATUS"	TEXT NOT NULL,
	PRIMARY KEY("ID_STATUS" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "TB_REQUISICAO" (
	"ID_REQUISICAO"	INTEGER NOT NULL,
	"ID_TABELA"	TEXT NOT NULL,
	"USUARIO"	TEXT NOT NULL,
	"ID_STATUS"	INTEGER NOT NULL,
	PRIMARY KEY("ID_REQUISICAO" AUTOINCREMENT),
	FOREIGN KEY("ID_STATUS") REFERENCES "TB_STATUS"("ID_STATUS"),
	FOREIGN KEY("ID_TABELA") REFERENCES "TB_TABELA"("ID")
);
CREATE TABLE IF NOT EXISTS "TB_REQ_CONEXAO" (
	"ID_REQ_CONEXAO"	INTEGER NOT NULL,
	"ID_CAMPO_CONEXAO"	INTEGER NOT NULL,
	"ID_REQUISICAO"	INTEGER NOT NULL,
	"ALTERACAO"	TEXT NOT NULL,
	"ALTERACAO_GOVERNANCA"	TEXT,
	PRIMARY KEY("ID_REQ_CONEXAO" AUTOINCREMENT),
	FOREIGN KEY("ID_REQUISICAO") REFERENCES "TB_REQUISICAO"("ID_REQUISICAO"),
	FOREIGN KEY("ID_CAMPO_CONEXAO") REFERENCES "TB_CAMPO_CONEXAO"("ID_CAMPO_CONEXAO")
);
CREATE TABLE IF NOT EXISTS "TB_VARIAVEL" (
	"ID_VARIAVEL"	INTEGER NOT NULL,
	"ID"	TEXT NOT NULL,
	"CONJUNTO_DADOS"	TEXT NOT NULL,
	"NOME_CAMPO"	TEXT NOT NULL,
	"TIPO_CAMPO"	TEXT NOT NULL,
	"TAMANHO_CAMPO"	TEXT NOT NULL,
	"TIPO_PESSOA"	TEXT NOT NULL,
	"DESCRICAO_CAMPO"	TEXT NOT NULL,
	"CH_PRIMARIA"	TEXT NOT NULL,
	"NULL"	TEXT NOT NULL,
	"UNQ"	TEXT NOT NULL,
	"LGPD"	TEXT NOT NULL,
	"REGRA_CRIACAO"	TEXT NOT NULL,
	"INDICADOR_AJUSTE_NOMENCLATURA_TABELA"	TEXT,
	PRIMARY KEY("ID_VARIAVEL" AUTOINCREMENT),
	FOREIGN KEY("CONJUNTO_DADOS") REFERENCES "TB_TABELA"("CONJUNTODADOS_PRODUTO"),
	FOREIGN KEY("ID") REFERENCES "TB_TABELA"("ID")
);
