 ('DB_PAN_DL_RAW.TB_OPERACOES_AQUARIUS_ACCCR','Operações','AWS.TB_OPERACOES_AQUARIUS_ACCCR','TB_OPERACOES_AQUARIUS_ACCCR','A tabela tb_operacoes_aquarius_acccr é uma tabela de dados contendo informações sobre sistema de gestão de consórcio. Ela contém detalhes sobre representantes, taxas de transação, tipos de comissão, debito ou crédito, tipos de pagamento, valores de pagamento, datas de ocorrência, datas de vencimento, contratos, grupos, cotas, filiais e outras informações relacionadas. Esta tabela também contém uma coluna de status, que pode ser usada para indicar se a linha de crédito está ativa ou não.',NULL,'S',NULL,'DB_PAN_DL_RAW','s3://pan-dl-prd-raw/operacoes/aquarius/acccr','-','eduardo.guimaraes.ext@panonline.com.br','Leandro De Souza Ciscar','Murielson Silva Santos','N',NULL,NULL,NULL,NULL),
 ('DB_PAN_DL_RAW.TB_OPERACOES_AQUARIUS_ACREP','Operações','AWS.TB_OPERACOES_AQUARIUS_ACREP','TB_OPERACOES_AQUARIUS_ACREP','A tabela tb_operacoes_aquarius_acrep é uma tabela que armazena informações de representantes que são credenciados ao Consórcio Aquarius. Esta tabela contém os seguintes campos: repres, nome, endereco, bairro, cidade, estado, cep, telefone, fis_jur, cgc_cpf, fantasia, tp_repre, sit_repr, tp_pagto, contato, fornec, banco, agencia, conta, document, inf_adic, dvagen, dvconcor, complemen, tipoender, numender, cod_ext, e_mail, filler, fabrican e anomesdia. Estes campos armazenam informações que incluem o nome e os detalhes de contato do representante, bem como informações sobre a situação do representante, a forma de pagamento, os dados bancários e outras informações importantes. Essa tabela é usada para fornecer informações sobre representantes ao Consórcio Aquarius.',NULL,'S',NULL,'DB_PAN_DL_RAW','s3://pan-dl-prd-raw/operacoes/aquarius/acrep','-','eduardo.guimaraes.ext@panonline.com.br','Leandro De Souza Ciscar','Murielson Silva Santos','N',NULL,NULL,NULL,NULL),
