 ('DB_PAN_DL_RAW.TB_CARTOES_B2K_ARQUIVO_CADASTRAL_MIS005','Cartões','AWS.TB_CARTOES_B2K_ARQUIVO_CADASTRAL_MIS005','TB_CARTOES_B2K_ARQUIVO_CADASTRAL_MIS005','Tabela armazena os dados Cadastral do Portador de Cartão PAN. Os tipos de registros são segregados por Tipo de Produto adquirido pelo Cliente na Home Page do Banco PAN, Cartões Multiplos, ou Débito ou Crédito por Bandeira Visa; MasterCard; Elo. A Tabela contem os com dados de Cadastro do Portador de Cartão, identificado pelo Numero do CPF, Conta/Cartão e as vias de Cartões geradas bem como o Status e Bloqueios na Conta ou Cartão por Titularidade. No Registro do Portador é possivel identificar :  1)Todos Produtos do cliente pelo CPF.2) As configurações de taxas e tarifas aplicadas por Conta/Cartão do Cliente PAN. 3)O Status de Conta e Cartão - bloqueios aplicados.4) Data de Vencimento da Fatura. 5)Funcionalidade ativas para a Conta/Cartão do Portador.6) Adicionais do cartão do Titular. 7)Dados do Cadastro completo e Endereço do Portador.','S','S','ONLINE','DB_PAN_DL_RAW','s3://pan-dl-prd-raw/cartoes/b2k/arquivo-cadastral-mis005','-','Rildo Henrique Da Silva Queiroz','Juliana Aparecida Lazzarini','Renata Tamagusuku Sanzoni','N',NULL,NULL,NULL,NULL),
